import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, useLocation } from 'react-router-dom';
import { ThemeProvider } from './contexts/ThemeContext';
import { MenuProvider } from './contexts/MenuContext';

// Import Components & Pages
import Navbar from './components/Navbar';
import DashboardLayout from './components/DashboardLayout';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import DashboardPage from './pages/DashboardPage';
import ForgotPasswordPage from './pages/ForgotPasswordPage';
import ResetPasswordPage from './pages/ResetPasswordPage';
import GoogleAuthSuccessPage from './pages/GoogleAuthSuccessPage';
import SettingsPage from './pages/SettingsPage';
import ProfilePage from './pages/ProfilePage';
import MenuBuilderPage from './pages/MenuBuilderPage';
import TemplatesPage from './pages/TemplatesPage';
import PublishPage from './pages/PublishPage';

function AppWrapper() {
  const location = useLocation();
  useEffect(() => {
  window.scrollTo(0, 0);
}, [location]);

  // Just show Navbar always – it hides itself on auth pages internally
  const isAuthenticated = Boolean(localStorage.getItem('authToken')); // You used 'authToken' in Navbar

  return (
    <>
      <Navbar />
      <main>
        <Routes>
          {/* Public / Auth Routes */}
          <Route path="/" element={<LoginPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/forgot-password" element={<ForgotPasswordPage />} />
          <Route path="/reset-password/:token" element={<ResetPasswordPage />} />
          <Route path="/auth/success" element={<GoogleAuthSuccessPage />} />

          {/* Protected Routes */}
          <Route
            path="/dashboard"
            element={isAuthenticated ? <DashboardPage /> : <Navigate to="/login" />}
          />
          <Route
            path="/dashboard/menu"
            element={isAuthenticated ? <DashboardLayout /> : <Navigate to="/login" />}
          />
          <Route
            path="/builder"
            element={isAuthenticated ? <MenuBuilderPage /> : <Navigate to="/login" />}
          />
          <Route
            path="/templates"
            element={isAuthenticated ? <TemplatesPage /> : <Navigate to="/login" />}
          />
          <Route
            path="/publish"
            element={isAuthenticated ? <PublishPage /> : <Navigate to="/login" />}
          />
          <Route
            path="/settings"
            element={isAuthenticated ? <SettingsPage /> : <Navigate to="/login" />}
          />
          <Route
            path="/profile"
            element={isAuthenticated ? <ProfilePage /> : <Navigate to="/login" />}
          />
        </Routes>
      </main>
    </>
  );
}

function App() {
  return (
    <ThemeProvider>
      <MenuProvider>
        <Router>
          <AppWrapper />
        </Router>
      </MenuProvider>
    </ThemeProvider>
  );
}

export default App;
